import React, { useState, useEffect } from 'react';


import './Mentions.css';


class Mentions extends React.Component{

    render(){

        return(
            
            <body id="Mentions">
                <span id="title">Mentions légale</span>
                <div id="Content">
                    <div className="Informations">
                        Noms et prénoms des développeurs du site
                        <div id="names">
                            <ul>
                                <li>Christopher Fauconnier</li>
                                <li>Diego Martin Lenoir</li>
                                <li>Simon Périquet</li>
                                <li>Simon Kinet</li>
                            </ul>
                        </div>
                    </div>

                </div>

            </body>
            
            
           

        )
    }


}

export default Mentions;
